import React from 'react';



function Entry(props){
    return(
        <div className="term">
        
          <dt>
            <span>{props.img}</span>
            <span>{props.name}</span>
          </dt>

          <dd>
            {props.meaning}
          </dd>

        </div>
    )
}

export default Entry;
